Guiño táctico a Podemos

Satisfacción ayer en las filas del PP. El ofrecimiento de Pedro Sánchez a Podemos y a toda el ala izquierda del Congreso de un pacto «más allá» del acuerdo alcanzado con Albert Rivera, despertó de su letargo a unas tropas populares muy castigadas últimamente por la inexplicable estrategia de su líder y por los casos de corrupción de Madrid y Valencia.
«Menudo papelón para el pobre Albert», me susurraba ayer una fuente cercana a Rajoy. El eje Moncloa/Génova atribuye a Sánchez un comportamiento «infiel» que, a su manera de ver, podría provocar la ruptura de la breve relación con Rivera incluso antes de que se produzca la votación de investidura. Wishfull thinking.
Aunque varios dirigentes de Ciudadanos advirtieron de que su partido no votaría un programa que se extralimite de lo pactado la semana pasada con el PSOE, la sangre no llegará al río.
Sánchez no se ha vuelto loco ¿Acaso alguien piensa que el líder del PSOE está dispuesto a poner en riesgo el acuerdo con Rivera, que, hoy por hoy, es su principal activo, a cambio de un coqueteo con Pablo Iglesias?
El propio líder de Podemos nos sacó de dudas tras salir inmediatamente a la palestra para rechazar cualquier entendimiento con el PSOE. Iglesias dijo en Twitter que el planteamiento de Sánchez «no es serio».
Si miramos las tripas de lo ofrecido por el PSOE a Podemos observamos que, en efecto, no contiene diferencias sustanciales con el documento firmado por Ciudadanos. Ni en las medidas económicas, ni en las de regeneración democrática puede decirse que el PSOE haya modificado su pacto con Rivera.
En eso, estoy de acuerdo con Iglesias: «Se trata de un corta y pega de lo acordado la semana pasada con Ciudadanos».
¿Cuál es entonces el objetivo de Sánchez al lanzar esa ofensiva de última hora sobre los partidos a su izquierda? ¿Es que el líder del PSOE mantiene aún la esperanza de que, con tal de echar a Rajoy de La Moncloa, Podemos, En Comú, Compromís e IU, se abalanzarán a sus brazos como náufragos en plena tormenta? No. El movimiento del secretario general del PSOE es puramente táctico. Se trata de hacer ver a la militancia de Podemos (no hay que olvidar que, según los datos que maneja el PSOE, 1,5 millones de los votantes que tuvo Pablo Iglesias el pasado 20-D provenían del caladero socialista) que la única opción realista de evitar que el PP siga en el poder es un Gobierno liderado por un socialista.
El secretario de Organización del PSOE, César Luena, puso el foco sobre el líder de Podemos el pasado domingo: ¿Se atrevería Podemos a someter a votación entre sus militantes la posibilidad de un gobierno presidido por Sánchez? Esa propuesta, claramente retórica, cuadra como un guante con la oferta hecha ayer por su partido al populismo de izquierdas. En resumen: puro postureo.
Tengo la certeza de que Sánchez da por perdidas las votaciones de esta semana y está ya en el precalentamiento para las próximas elecciones.
La posibilidad de que el PP se abstenga es tan remota como la abstención de Podemos. Sin embargo, el acuerdo PSOE/Ciudadanos tiene sentido en sí mismo y eso es lo que ambos partidos van a poner en valor de aquí al 26 de junio. Si es que antes Rajoy no nos da una sorpresa.
El Sr. Sanchez pactaría con cualquiera que le diera la posibilidad de se presidente, pero no para solucionar los problemas existentes en España, sino en beneficio propio.
Lo raro es que a estas alturas de la película algún partido se fie del sr. Sanchez. Yo si fuese Podemos haría lo mismo, y si C¿s no hubiese perdido la cabeza firmando ese engendro, habría que dejar al PSOE que se cociese en su propia salsa, esto es, evidenciar su falta de programa más allá de echar a Rajoy del poder, recalcar sus contradicciones, preguntar de donde sacarían los fondos para cumplir todo lo que prometen a sus posibles socios, y un largo y lamentable etcétera. Este hombre, carente de cualquier talante para ser presidente de un país serio, representa un verdadero peligro. En política parece que todo vale y el Sr. Sanchez así lo demuestra. Yo por regeneración democrática entiendo ,entre otras cosas, valores y coherencia, y aquí no veo nada de esto.
